import React from "react";
import ReactDOM from "react-dom";
import "./index.css"; // optional for styling

function App() {
  return (
    <div>
      <h1>Welcome to My React Website!</h1>
    </div>
  );
}

ReactDOM.render(<App />, document.getElementById("root"));
